import React, { useState } from 'react';
import {
  Container,
  Paper,
  TextField,
  Button,
  Grid,
  Card,
  CardContent,
  Typography,
  Box,
  Alert,
  CircularProgress,
  LinearProgress,
} from '@mui/material';
import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:8000/api';

function App() {
  const [formData, setFormData] = useState({
    age: 72,
    sex: 'M',
    bmi: 26.5,
    grip_strength_max: 25.3,
    grip_strength_norm: 0.32,
    chair_stand_time: 15,
    gait_speed_m_s: 0.8,
    tug_time: 18,
    sppb_score: 7,
    asm_kg: 22.5,
    asmi_kg_m2: 8.2,
    sarc_f_score: 4,
    falls_last_year: 1,
    physical_activity_level: 'moderate',
    comorbidity_count: 2,
  });

  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: name === 'sex' || name === 'physical_activity_level' 
        ? value 
        : parseFloat(value) || value
    }));
  };

  const handlePredict = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await axios.post(`${API_URL}/predict`, formData);
      setPrediction(response.data);
    } catch (err) {
      setError(err.response?.data?.detail || 'Tahmin sƒ±rasƒ±nda hata olu≈ütu');
    } finally {
      setLoading(false);
    }
  };

  const getSarcopeniaLabel = (classNum) => {
    const labels = {
      '0': 'Normal (Sarkopeni Yok)',
      '1': 'Sarkopeni',
      '2': '≈ûiddetli Sarkopeni'
    };
    return labels[classNum];
  };

  const getSarcopeniaColor = (classNum) => {
    const colors = {
      '0': '#4caf50', // Green
      '1': '#ff9800', // Orange
      '2': '#f44336'  // Red
    };
    return colors[classNum];
  };

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Typography variant="h3" component="h1" gutterBottom sx={{ mb: 4, fontWeight: 'bold' }}>
        üè• Sarkopeni Tespiti Sistemi
      </Typography>
      <Typography variant="subtitle1" gutterBottom sx={{ mb: 4, color: 'text.secondary' }}>
        EWGSOP2 kriterlerine dayalƒ± yapay √∂ƒürenme ile sarkopeni tahminleme
      </Typography>

      <Grid container spacing={3}>
        {/* Sol kolon - Giri≈ü Formu */}
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 3 }}>
            <Typography variant="h5" gutterBottom sx={{ mb: 3 }}>
              üìã Hasta Bilgileri
            </Typography>

            <Box sx={{ display: 'grid', gap: 2 }}>
              {/* Demografik */}
              <Box sx={{ p: 2, bgcolor: '#f5f5f5', borderRadius: 1 }}>
                <Typography variant="subtitle2" sx={{ fontWeight: 'bold', mb: 2 }}>
                  Demografik Bilgiler
                </Typography>
                <Grid container spacing={2}>
                  <Grid item xs={6}>
                    <TextField
                      fullWidth
                      label="Ya≈ü"
                      name="age"
                      type="number"
                      value={formData.age}
                      onChange={handleInputChange}
                      size="small"
                    />
                  </Grid>
                  <Grid item xs={6}>
                    <TextField
                      fullWidth
                      label="Cinsiyet"
                      name="sex"
                      select
                      value={formData.sex}
                      onChange={handleInputChange}
                      size="small"
                      SelectProps={{
                        native: true,
                      }}
                    >
                      <option value="M">Erkek</option>
                      <option value="F">Kadƒ±n</option>
                    </TextField>
                  </Grid>
                  <Grid item xs={12}>
                    <TextField
                      fullWidth
                      label="BMI (kg/m¬≤)"
                      name="bmi"
                      type="number"
                      value={formData.bmi}
                      onChange={handleInputChange}
                      size="small"
                      step="0.1"
                    />
                  </Grid>
                </Grid>
              </Box>

              {/* Kas G√ºc√º */}
              <Box sx={{ p: 2, bgcolor: '#f5f5f5', borderRadius: 1 }}>
                <Typography variant="subtitle2" sx={{ fontWeight: 'bold', mb: 2 }}>
                  Kas G√ºc√º
                </Typography>
                <Grid container spacing={2}>
                  <Grid item xs={6}>
                    <TextField
                      fullWidth
                      label="Kavrama G√ºc√º (kg)"
                      name="grip_strength_max"
                      type="number"
                      value={formData.grip_strength_max}
                      onChange={handleInputChange}
                      size="small"
                      step="0.1"
                    />
                  </Grid>
                  <Grid item xs={6}>
                    <TextField
                      fullWidth
                      label="Sandalyeden Kalma (s)"
                      name="chair_stand_time"
                      type="number"
                      value={formData.chair_stand_time}
                      onChange={handleInputChange}
                      size="small"
                      step="0.1"
                    />
                  </Grid>
                </Grid>
              </Box>

              {/* Kas K√ºtlesi */}
              <Box sx={{ p: 2, bgcolor: '#f5f5f5', borderRadius: 1 }}>
                <Typography variant="subtitle2" sx={{ fontWeight: 'bold', mb: 2 }}>
                  Kas K√ºtlesi
                </Typography>
                <Grid container spacing={2}>
                  <Grid item xs={6}>
                    <TextField
                      fullWidth
                      label="ASM (kg)"
                      name="asm_kg"
                      type="number"
                      value={formData.asm_kg}
                      onChange={handleInputChange}
                      size="small"
                      step="0.1"
                    />
                  </Grid>
                  <Grid item xs={6}>
                    <TextField
                      fullWidth
                      label="ASMI (kg/m¬≤)"
                      name="asmi_kg_m2"
                      type="number"
                      value={formData.asmi_kg_m2}
                      onChange={handleInputChange}
                      size="small"
                      step="0.1"
                    />
                  </Grid>
                </Grid>
              </Box>

              {/* Fiziksel Performans */}
              <Box sx={{ p: 2, bgcolor: '#f5f5f5', borderRadius: 1 }}>
                <Typography variant="subtitle2" sx={{ fontWeight: 'bold', mb: 2 }}>
                  Fiziksel Performans
                </Typography>
                <Grid container spacing={2}>
                  <Grid item xs={4}>
                    <TextField
                      fullWidth
                      label="Y√ºr√ºy√º≈ü (m/s)"
                      name="gait_speed_m_s"
                      type="number"
                      value={formData.gait_speed_m_s}
                      onChange={handleInputChange}
                      size="small"
                      step="0.1"
                    />
                  </Grid>
                  <Grid item xs={4}>
                    <TextField
                      fullWidth
                      label="TUG (s)"
                      name="tug_time"
                      type="number"
                      value={formData.tug_time}
                      onChange={handleInputChange}
                      size="small"
                      step="0.1"
                    />
                  </Grid>
                  <Grid item xs={4}>
                    <TextField
                      fullWidth
                      label="SPPB"
                      name="sppb_score"
                      type="number"
                      value={formData.sppb_score}
                      onChange={handleInputChange}
                      size="small"
                      step="1"
                      inputProps={{ min: 0, max: 12 }}
                    />
                  </Grid>
                </Grid>
              </Box>

              {/* Ek Bilgiler */}
              <Box sx={{ p: 2, bgcolor: '#f5f5f5', borderRadius: 1 }}>
                <Typography variant="subtitle2" sx={{ fontWeight: 'bold', mb: 2 }}>
                  Ek Bilgiler
                </Typography>
                <Grid container spacing={2}>
                  <Grid item xs={6}>
                    <TextField
                      fullWidth
                      label="SARC-F Skoru"
                      name="sarc_f_score"
                      type="number"
                      value={formData.sarc_f_score}
                      onChange={handleInputChange}
                      size="small"
                      step="1"
                      inputProps={{ min: 0, max: 10 }}
                    />
                  </Grid>
                  <Grid item xs={6}>
                    <TextField
                      fullWidth
                      label="D√º≈üme (son 1 yƒ±l)"
                      name="falls_last_year"
                      type="number"
                      value={formData.falls_last_year}
                      onChange={handleInputChange}
                      size="small"
                      step="1"
                      inputProps={{ min: 0 }}
                    />
                  </Grid>
                  <Grid item xs={6}>
                    <TextField
                      fullWidth
                      label="Fiziksel Aktivite"
                      name="physical_activity_level"
                      select
                      value={formData.physical_activity_level}
                      onChange={handleInputChange}
                      size="small"
                      SelectProps={{
                        native: true,
                      }}
